import axios from "axios";
import React, {Component} from "react";

class Consumer extends Component {
    constructor(props) {
        super(props);
        this.state = {
            response: '',
            data: '',
            search: [],
            users_subscription: [],
            selectedVal: "",
        }
    }

    componentDidMount() {
        let params = {
            "action": "wbsearchentities",
            "language": "en",
            "format": "json",
            "search": "Barack obama",
            "origin": "*",
            "limit": 5
        }

        let url = "https://www.wikidata.org/w/api.php";
        //for (let k in params) { url.searchParams.append(k, params[k]); }
        /* let response = fetch('https://www.wikidata.org/w/api.php?action=wbsearchentities&language=en&format=json&search=poutine&origin=*', {
            method: "GET",
            mode: "no-cors",
            origin: "*",
            headers: {
                "Access-Control-Allow-Origin": "*"
            },
            credentials: "omit"
            },
        ).then(result => {
            console.log('result ===> ', result);
            return result.text();
        }).then(data => console.log('data ====> ', data)).catch (err => console.log('error ===> ', err)); */

        axios.get(url, {params: params}).then(result => {

            console.log('axios result ===> ', result);
            console.log(result.data.searchinfo);
            this.setState({response: result.data, search: result.data.search})
        }).catch(err => console.log('axios error ===> ', err));

        axios.get("http://www.wikidata.org/entity/Q76", ).then(result => {

            console.log('axios result ===> ', result);
           // console.log(result.data.searchinfo);
            //this.setState({response: result.data, search: result.data.search})
        }).catch(err => console.log('axios error ===> ', err));

    }

    render() {
        return (
            <>

                <h3>The Last five presidents of united states of America</h3>
                <div>

                    {/*{this.state.response.search.length}*/}

                    {this.state.search && this.state.search.map((element) => (
                        <>
                            <p>{element.id}</p>
                            <p>{element.display.description.value}</p>
                        </>
                    ))}
                    {JSON.stringify(this.state.response.searchinfo)}
                </div>

            </>
        )
    }
}

export default Consumer;
